import React, { useState, useEffect } from 'react';
import ProgrammingCalendar from '../components/ProgrammingCalendar';
import initialSchedule from '../data/september-2025-schedule.json';

const Programming = () => {
  const [programming, setProgramming] = useState([]);
  const [temporalProgramming, setTemporalProgramming] = useState([]);

  useEffect(() => {
    // Simulate fetching data from the backend
    setProgramming(initialSchedule);
    setTemporalProgramming(initialSchedule);
  }, []);

  const handleSave = () => {
    // Simulate sending data to the backend
    console.log('Saving to backend:', temporalProgramming);
    setProgramming(temporalProgramming);
  };

  return (
    <div>
      <h1>Shift Programming</h1>
      <ProgrammingCalendar schedule={temporalProgramming} setSchedule={setTemporalProgramming} />
      <button onClick={handleSave}>Save Programming</button>
    </div>
  );
};

export default Programming;
